import React, { lazy, Suspense, useState } from "react";

const ExplanationButtons = () => {
  //const [explanations, setExplanations] = useState([]);
  var explanations = [];
  var componentName = "Stocks";
  explanations = ["Stocks"];
  //const DynamicComponent = lazy(() => import(`./${componentName}`));

  const handleClick = (e) => {
    const val = e.currentTarget.getAttribute("expl");
    const DynamicComponent = lazy(() => import(`./${val}`));
    return (
      <Suspense fallback={<div>Loading...</div>}>
        <DynamicComponent />
      </Suspense>
    );
  };

  var res = explanations.map((expl) => (
    <button
      className="button buttonExplanation"
      key="hi"
      onClick={handleClick}
      expl={expl}
    >
      {expl}
    </button>
  ));
  return res;
};

export default ExplanationButtons;

// NOTE: explanation button directly on explanation page
